import React , { useState } from 'react';

export default function Contacts({contacts, user}) {

	const [username, setUsername] = useState();

	const [currentView, setCurrentView] = useState()

	const handleContactClick = (e) => {
		setCurrentView(e.target.id);
		console.log(e.target.contact.username)
	}

	return (
	<div className='contacts'>
		{user && contacts && (contacts.map((contact, id) => {
			return (<div className='contact' key={id} onClick={(e) => handleContactClick(e)}>
				{contact.username}
			</div>)
		}))}
	</div>
	)
}
